INSERT INTO `chapters` VALUES ('Tìm kiếm tài liệu, đọc hiểu và ghi nhớ tài liệu','TK','<p><span style=\"font-size: 12pt;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://tlc.tvu.edu.vn/knm/img/upload/hinh%20ky%20nang/timkiem.jpg\" alt=\"Kỹ năng T&igrave;m kiếm t&agrave;i liệu, đọc hiểu v&agrave; ghi nhớ t&agrave;i liệu\" width=\"720\" height=\"280\" /></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Sau khi học kỹ năng n&agrave;y, bạn sẽ vận dụng Qui tr&igrave;nh t&igrave;m kiếm 3 bước để t&igrave;m kiếm t&agrave;i liệu tr&ecirc;n Internet hiệu quả hơn; bạn sẽ x&aacute;c định được tư thế, t&acirc;m thế v&agrave; phương ph&aacute;p đọc hiểu t&agrave;i liệu; đồng thời, bạn sẽ vận dụng &ldquo;4 bước t&oacute;m &yacute;&rdquo; để đọc v&agrave; ghi nhớ t&agrave;i liệu.</span></p>',3,6,2,NULL,NULL,1),('Thuyết trình','TT','<p><span style=\"font-size: 12pt;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://tlc.tvu.edu.vn/knm/img/upload/hinh%20ky%20nang/thuyettrinh.jpg\" alt=\"Kỹ năng Thuyết tr&igrave;nh\" width=\"720\" height=\"280\" /></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Sau khi học xong kỹ năng n&agrave;y, bạn sẽ c&oacute; thể chuẩn bị được một b&agrave;i thuyết tr&igrave;nh; r&egrave;n luyện c&aacute;c kỹ năng thuyết tr&igrave;nh hiệu quả; vận dụng c&aacute;c kỹ năng về ngữ điệu, giọng n&oacute;i, cử chỉ phi ng&ocirc;n ngữ để l&agrave;m tăng t&iacute;nh hiệu quả của b&agrave;i thuyết tr&igrave;nh cũng như những điểm cần lưu &yacute; để thực hiện tốt b&agrave;i thuyết tr&igrave;nh.</span></p>',3,6,2,NULL,NULL,2),('Làm việc nhóm','LV','<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><img src=\"http://tlc.tvu.edu.vn/knm/img/upload/hinh%20ky%20nang/lamviecnhom.jpg\" alt=\"kỹ năng l&agrave;m việc nh&oacute;m\" width=\"720\" height=\"280\" /></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Sau khi tham gia lớp tập huấn, sinh vi&ecirc;n sẽ c&oacute; thể:</span><br /><span style=\"font-size: 12pt;\">X&aacute;c định được v&agrave;i tr&ograve; của c&aacute; nh&acirc;n khi l&agrave;m việc độc lập v&agrave; nh&oacute;m; X&aacute;c định những giai đoạn của l&agrave;m việc nh&oacute;m (m&ocirc; h&igrave;nh tuckman); Vận dụng được c&aacute;c kiểu tư duy khi l&agrave;m việc nh&oacute;m; &Yacute; thức được tr&aacute;ch nhiệm của c&aacute; nh&acirc;n khi l&agrave;m việc độc lập v&agrave; nh&oacute;m</span></p>',3,6,1,NULL,NULL,3),('Tư duy sáng tạo và tư duy phê phán','ST','<p><span style=\"font-size: 12pt;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://tlc.tvu.edu.vn/knm/img/upload/hinh%20ky%20nang/sangtao.jpg\" alt=\"Kỹ năng tư duy s&aacute;ng tạo v&agrave; ph&ecirc; ph&aacute;n\" width=\"720\" height=\"280\" />Sau khi học xong kỹ năng n&agrave;y, bạn sẽ c&oacute; thể r&egrave;n luyện được c&aacute;ch suy nghĩ c&oacute; s&aacute;ng tạo v&agrave; c&oacute; ph&ecirc; ph&aacute;n. Bạn sẽ được r&egrave;n luyện c&aacute;c kỹ năng nghe, n&oacute;i, đọc ,viết c&oacute; ph&ecirc; ph&aacute;n. B&ecirc;n cạnh đ&oacute;, bạn sẽ vận dụng c&aacute;c kiểu tư duy ph&ecirc; ph&aacute;n khi nh&igrave;n nhận sự việc, Ngo&agrave;i ra, bạn c&ograve;n được vận dụng c&aacute;c chiến lược để r&egrave;n luyện trở th&agrave;nh người suy nghĩ c&oacute; ph&ecirc; ph&aacute;n trước c&aacute;c sự việc trong cuộc sống.</span></p>',3,6,1,NULL,NULL,4),('Quản lý thời gian và tổ chức công việc','TG','<p><span style=\"font-size: 12pt;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://tlc.tvu.edu.vn/knm/img/upload/hinh%20ky%20nang/quanlythoigian.jpg\" alt=\"Kỹ năng Quản l&yacute; thời gian v&agrave; tổ chức c&ocirc;ng việc: \" width=\"720\" height=\"280\" /></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Sau khi học xong kỹ năng n&agrave;y, bạn sẽ x&aacute;c định được c&aacute;c nguy&ecirc;n nh&acirc;n g&acirc;y l&atilde;ng ph&iacute; thời gian v&agrave; c&aacute;c nguy&ecirc;n tắc quản l&yacute; thời gian. Đồng thời, bạn sẽ thiết lập mục ti&ecirc;u SMART, kế hoạch STARS cũng như sử dụng Ma trận quản l&yacute; thời gian để tổ chức c&ocirc;ng việc v&agrave; quản l&yacute; thời gian hiệu quả hơn.</span></p>',3,6,1,NULL,NULL,5),('Giải quyết vấn đề và ra quyết định','VD','<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">&nbsp;<img src=\"http://tlc.tvu.edu.vn/knm/img/upload/hinh%20ky%20nang/giaiquyetvde.jpg\" alt=\"Kỹ năng giải quyết vấn đề v&agrave; ra quyết định:\" width=\"720\" height=\"280\" /></span><span style=\"font-size: 12pt;\">Giải quyết vấn đề v&agrave; ra quyết định l&agrave; một kỹ năng rất cần thiết trong học tập, l&agrave;m việc v&agrave; mọi thứ kh&aacute;c xoay quanh cuộc sống của ch&uacute;ng ta. Trong c&ocirc;ng việc hằng ng&agrave;y, khi c&oacute; một vấn đề n&agrave;o đ&oacute; xảy ra, ch&uacute;ng ta thường ph&acirc;n v&acirc;n kh&ocirc;ng biết giải quyết theo hướng n&agrave;o. Sau khi học xong kỹ năng n&agrave;y người học c&oacute; thể x&aacute;c định được bản chất của vấn đề cần giải quyết đồng thời người học cũng &aacute;p dụng được qui tr&igrave;nh giải quyết vấn đề v&agrave; ra quyết định một c&aacute;ch hiệu quả.</span></p>',3,6,1,NULL,NULL,6),('Quản lý bản thân','BT','<p><span style=\"font-size: 12pt;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://tlc.tvu.edu.vn/knm/img/upload/hinh%20ky%20nang/quanlybanthan.jpg\" alt=\"Kỹ năng Quản l&yacute; bản th&acirc;n\" width=\"720\" height=\"280\" />Sau khi tham gia lớp tập huấn, sinh vi&ecirc;n sẽ c&oacute; thể:</span><br /><span style=\"font-size: 12pt;\">X&aacute;c định được c&aacute;c nguy&ecirc;n nh&acirc;n, biểu hiện của stress (căng thẳng);Tr&igrave;nh b&agrave;y được c&aacute;c giải ph&aacute;p khắc phục stress; X&aacute;c định được c&aacute;c c&aacute;ch kiếm tiền v&agrave; tiết kiệm tiền; Hoạch định được &ldquo;ng&acirc;n s&aacute;ch&rdquo; c&aacute; nh&acirc;n; Nhận thức được tầm quan trọng của việc khắc phục stress v&agrave; việc quản l&yacute; t&agrave;i ch&iacute;nh c&aacute; nh&acirc;n.</span></p>',3,6,1,NULL,NULL,8);
