INSERT INTO `messages` VALUES (47,'Tạm dừng hệ thống để để nâng cấp.','','<p style=\"text-align: left;\"><span style=\"font-size: 10pt;\">Để phục vụ tốt hơn cho Giảng vi&ecirc;n v&agrave; c&aacute;c bạn sinh vi&ecirc;n trong việc giảng dạy v&agrave; đăng k&yacute; Kỹ năng mềm, nay Trung t&acirc;m Hỗ trợ - Ph&aacute;t triển Dạy v&agrave; Học tiến h&agrave;nh n&acirc;ng cấp hệ thống (http://tlc.tvu.edu.vn/knm ) <span style=\"color: #ff0000;\">từ 7 giờ 30 s&aacute;ng 30/12/2014 đến hết ng&agrave;y 02/01/2015.</span></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 10pt;\">Trong thời gian n&acirc;ng cấp hệ thống sẽ ngưng phục vụ (Sẽ kh&ocirc;ng đăng nhập được). Trung t&acirc;m Hỗ trợ - Ph&aacute;t triển Dạy v&agrave; Học xin th&ocirc;ng b&aacute;o đến Qu&yacute; Thầy (C&ocirc;) v&agrave; c&aacute;c bạn sinh vi&ecirc;n được r&otilde; để sắp xếp cho ph&ugrave; hợp. </span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 10pt;\">Xin tr&acirc;n trọng k&iacute;nh ch&agrave;o ./.</span></p>',1,11,1,0,'2014-12-31 15:02:12','2015-01-13 14:39:26',3),(48,'Thông báo về việc quản lý đăng ký học kỹ năng mềm','','<p><span style=\"font-size: 10pt;\">Kể từ ng&agrave;y 03/01/2015, Hệ thống quản l&yacute; đăng k&yacute; học kỹ năng mềm đ&atilde; được bổ sung t&iacute;nh năng hiển thị <strong>trạng th&aacute;i</strong> c&aacute;c lớp kỹ năng mềm m&agrave; c&aacute;c bạn đăng k&yacute; <em>(Đ&atilde; mở, Đ&atilde; hủy,...)</em> để c&aacute;c bạn tiện theo d&otilde;i. </span></p>\r\n<p><span style=\"font-size: 10pt;\">Do đ&oacute; Trung t&acirc;m sẽ <strong>kh&ocirc;ng gởi email th&ocirc;ng b&aacute;o t&igrave;nh trạng lớp được mở ch&iacute;nh thức hay hủy nữa</strong>, mọi th&ocirc;ng tin về lớp kỹ năng mềm đều được cập nhật tại trang web quản l&yacute; kỹ năng mềm (http://tlc.tvu.edu.vn/knm/&nbsp;). </span></p>\r\n<p><span style=\"font-size: 10pt;\">Đề nghị c&aacute;c bạn thường xuy&ecirc;n đăng nhập để kiểm tra th&ocirc;ng tin. Tr&acirc;n trọng.</span></p>',1,25229,1,0,'2015-01-08 17:23:45','2015-01-13 14:39:09',3),(50,'Thông báo số 938/TB-ĐHTV về việc quản lý đăng ký học kỹ năng mềm bắt buộc đối với sinh viên khóa 2012 (Đại học) và Khóa 2013 (Đại học, cao đẳng, Trung cấp chuyên nghiệp) hệ chính quy','','<p><span style=\"font-size: 12pt;\">Vui l&ograve;ng xem nội dung tại file&nbsp;<a href=\"http://tlc.tvu.edu.vn/knm/img/upload/pdf/TB938.pdf\" target=\"_blank\">Đ&iacute;nh k&egrave;m</a></span></p>',1,25229,1,0,'2015-01-13 14:05:39','2015-01-13 14:35:07',3),(51,'Thông báo số 1584/TB-ĐHTV về việc đăng ký học kỹ năng mềm bắt buộc đối với sinh viên các lớp  Trung cấp Chuyên nghiệp - Khóa 2013 Hệ chính quy','','<p>Vui l&ograve;ng xem nội dung tại file&nbsp;<a href=\"http://tlc.tvu.edu.vn/knm/img/upload/pdf/TB1584.pdf\">đ&iacute;nh k&egrave;m</a></p>',1,25229,NULL,0,'2015-01-13 14:33:12','2015-01-13 14:33:12',3),(52,'Thông báo về việc đăng ký học kỹ năng mềm bắt buộc đối với sinh viên bậc Đại học, Cao đẳng, Trung cấp chuyên nghiệp hệ chính quy khóa 2014','','<p>Vui l&ograve;ng xem nội dung tại file<a href=\"http://tlc.tvu.edu.vn/knm/img/upload/pdf/TB1774.pdf\"> đ&iacute;nh k&egrave;m</a></p>',1,25229,NULL,0,'2015-01-13 14:38:10','2015-01-13 14:38:10',3);
